import './chart.css';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


function Chart() {

    const data = [
  {
    name: 'Jan',
    "Active User": 4000,
  },
  {
    name: 'Feb',
    "Active User": 3000,

  },
  {
    name: 'March',
    "Active User": 2000,
  },
  {
    name: 'April',
    "Active User": 2780,
  },
  {
    name: 'May',
    "Active User": 1890,
  },
  {
    name: 'June',
    "Active User": 2390,
  },
  {
    name: 'July',
    "Active User": 3490
  },

  {
    name: 'Aug',
    "Active User": 3490
 },

{
    name: 'Sept',
    "Active User": 3490
},
{
    name: 'Oct',
    "Active User": 3490
},
{
name: 'Nov',
"Active User": 3490
},
{
name: 'Dec',
"Active User": 3490
},
];
    return (
        <div className="chart">
            <h2 className="charttitle">Sales Analytics</h2>
            <ResponsiveContainer width="100%" aspect={4 / 1}>
                <LineChart data={data}>
                    <XAxis dataKey="name" stroke="#5550bd" />
                    <Line type="mo" dataKey="Active User" stroke="#5550bd"/>
                    <Tooltip />
                    <CartesianGrid stroke="#e0dfdf" strokeDasharray/>
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}


export default Chart;
